description:
Јединствени информациони систем информатора о раду садржи податке о органима јавне власти као што су органи Републике Србије, аутономне покрајине, општине, градова, јавних предузећа, установа и сл. (погледати члана 3. тачка 1 до 7 Закона о слободном приступу информацијама од јавног значаја).

Сваки Информатор садржи:
1) основне податке о органу и информатору (укључујући радно време и информацију о приступачности особама са инвалидитетом објеката које користи орган); 
2) организациону структуру (органиграм); 
3) имена, податке за контакт и опис функција руководилаца организационих јединица; 
4) опис правила у вези са јавношћу рада; 
5) опис надлежности, овлашћења и обавеза; 
6) опис поступања у оквиру надлежности, овлашћења и обавеза; 
7) за колегијалне органе, податке о одржаним седницама и опис начина доношења одлука; 
8) навођење прописа које орган примењује у свом раду и прописа за чије доношење је надлежан; 
9) навођење стратегија, програма, планова и извештаја које је донео орган; 
10) навођење аката из тач. 8) и 9) овог става који су у поступку припреме од стране органа; 
11) списак услуга које орган пружа заинтересованим лицима; 
12) поступак ради пружања услуга из тачке 11) овог става; 
13) преглед података о пруженим услугама из тачке 11) овог става; 
14) финансијске податке (податке о буџету, односно финансијском плану и изворима прихода); 
15) податке о јавним набавкама, укључујући план јавних набавки и списак закључених уговора о набавкама добара, услуга, радова и непокретности, са вредностима закључених уговора, датумом закључења и роком трајања; 
16) податке о државној помоћи (са подацима о субјектима субвенција и донација и њиховим износима); 
17) податке о извршеним инспекцијама и ревизијама пословања органа; 
18) податке о исплаћеним платама, зарадама и другим примањима, укључујући податке о платама органа руковођења, односно управљања и руководилаца организационих јединица; 
19) податке о средствима рада и објектима које орган поседује, односно користи; 
20) чување носача информација; 
21) врсте информација у поседу, укључујући садржај база података и регистара којима рукује орган; 
22) врсте информација којима орган власти омогућава приступ; 
23) списак најчешће тражених информација од јавног значаја; 
24) информације о подношењу захтева, са адресама за пријем поште и електронске поште и подацима о роковима за поступање по захтеву, праву на правно средство и лицу надлежном за поступање по захтеву.

За тачност и потпуност података у информатору и његово редовно ажурирање, одговоран је руководилац органа јавне власти.

Агенција за лекове и медицинска средства Србије је надлежна да:

- издаје дозволе за лек, одлучује о измени и допуни, обнови и преносу, као и престанку важења дозволе за лек;
- врши регистрацију медицинског средства, измене и допуне, продужење регистрације, као и брисање медицинског средства из Регистра медицинских средстава;
- врши упис у Регистар традиционалних биљних лекова, односно упис у Регистар хомеопатских лекова;
- издаје дозволе за спровођење клиничког испитивања лека и медицинског средства, одлучује о измени и допуни дозволе, односно протокола о спровођењу клиничког испитивања лекова, доноси одлуке у вези с пријавом клиничког испитивања, врши контролу спровођења клиничког испитивања;
- прати нежељене реакције на лекове (у даљем тексту: фармаковигиланца), као и нежељене реакције на медицинска средства (у даљем тексту: вигиланца медицинских средстава);
- издаје уверења за потребе извоза лекова и медицинских средстава у складу с препорукама Светске здравствене организације;
- одобрава увоз лекова и медицинских средстава за лечење одређеног пацијента или групе пацијената, као и лекова или медицинских средстава за научна и медицинска истраживања;
- врши категоризацију лекова, односно медицинских средстава;
- одобрава оглашавање лекова и медицинских средстава;
- даје информације и предлоге за рационално коришћење лекова и медицинских средстава;
- повезује се са међународним мрежама информација о лековима и медицинским средставима и са агенцијама надлежним за лекове и медицинска средства и њиховим асоцијацијама;
- учествује у планирању и спровођењу систематске контроле лекова и медицинских средстава и узимању случајних узорака из промета;
- даје мишљења за увоз и извоз узорака ћелија, односно ткива за поступак клиничког испитивања лековима;
- врши контролу квалитета лекова и медицинских средстава;
- припрема стручне публикације из надлежности Агенције;
- врши и друге послове, у складу са законом.

Агенција активно учествује у развоју фармацеутске делатности у Србији, изради подзаконских прописа, даљој доградњи националне политике у области лекова и медицинских средстава и међународној сарадњи.

