_Адресни регистар_ је основни и јавни регистар који садржи податке о улицама (утврђене одлукама јединица локалне самоуправе) и кућним бројевима за територију Републике Србије.

Уређен је _Законом о Регистру просторних јединица и Адресном регистру_ (Сл. гласник РС број 9 од 4.02.2020. године). Подаци адресног регистра су јавни и део су Националне инфраструктуре геопросторних података и користе се у складу са прописима којима се уређује електронска управа. 

Законом је дефинисан појам адресе као структуирани скуп геопросторних података који јединствено одређује локацију и идентификацију непокретности на коју се односи. 

Адресни регистар обухвата и утврђивање кућних бројева за стамбене и пословне зграде, као и за катастарске парцеле које су урбанистичким планом предвиђене за изградњу.

_Податке скупа Адресни регистар чине два ресурса:_
-Геометрија улица АР у форматима CSV и GPKG;
-Геометрија кућних бројева АР у форматима CSV и GPKG.

_са следећим подацима:_
-назив улице;
-матични број улице;
-врста улице;
-кућни број;
-јединствени адресни код;
-назив и матични број општине;
-назив и матични број насељеног места;
-назив и матични број катастарске општине;
-број катастарске парцеле;
-број дела катастарске парцеле под објектом за објекте који су уписани у базу података катастра непокретности.

У складу са _Законом о републичким административним таксама_, адресни регистар је отворен податак и омогућено је преузимање и коришћење у складу са _Законом о електронској управи_. 
Подаци адресног регистра воде се и одржавају у централној бази адресног регистра која је доступна трећим лицима са ажурношћу на недељном нивоу.

Позивамо грађане да користе ове податке и да нам пријаве могуће грешке на електронску адресу mojaadresa@rgz.gov.rs.

![овде унесите опис слике](https://rgz.gov.rs/content/pages/registri-rgz-a/adresni-registar/AR.JPG "овде унесите наслов слике")

Сет података садржи податке о 362 локације у 155 јединица локалне самоуправе на којима грађани могу да преузму параметре за двофакторску аутентикацију (eID) и на тај начин користе услуге електронске управе.

Скуп података садржи ресурсе о:

Називу јединица локалне самоуправе или градске општине на којима је могуће преузети еИД;
Адреси на којој се налазе објекти поште (еИД) или локалне пореске администрације (ЛПА);
Радном времену током радне недеље;
Радном времену током суботе и недеље;
Геолокације објеката.

Сет се ажурира по потреби.

Извор: Канцеларија за информационе технологије и електронску управу

Регистар издатих енергетских дозвола и регистар енергетских дозвола које су престале да важе садржи:

- број и датум решења о издавању енергетске дозволе;
- податке о подносиоцу захтева коме је издата енергетска дозвола;
- податке о врсти енергетског објекта;
- основне техничке и друге податке о енергетском објекту;
- податке о локацији енергетског објекта;
- податке о инвестиционој вредности енергетског објекта;
- рок важења издате, односно продужене енергетске дозволе.

Регистри се објављују на интернет страници министарства надлежног за послове енергетике и ажурирају се на свака три месеца, у складу са правилником (у пракси се регистар ажурира двапут месечно или чешће, како се додају нови подаци).
